import './App.css';
import ComponenteConFragment from './ComponenteConFragment';
import { ComponenteConDiv } from './ComponenteConDiv';
import VariablesEnComponentes from './VariablesEnComponentes';

function App() {
  return (
    <div className="App">
      <ComponenteConFragment></ComponenteConFragment>
      <ComponenteConDiv></ComponenteConDiv>
      <VariablesEnComponentes></VariablesEnComponentes>
    </div>
  );
}

export default App;
